import React from "react";
import "./CardList.css"
function CardList({mtgCards}) {
    console.log(mtgCards)
    const mtg = mtgCards.map((mtgCard) => {return <div className="ui card eight wide column" key={mtgCard.id}><img src={mtgCard.imageUrl}/></div>})
    return(
        <div className="ui three stackable cards">
            {mtgCards.map()}

        </div>
    )
}

export default CardList
